transaction.handlers:
var table_values;

// Handles the transaction start event.
function onTransactionStarted() {
	if (table_values != null) {
		if (!table_values.equals("")) {
			table_values = table_values.split("|");
		}
	}
}

var dfInteracts = new Array();
var inter = new dfInteract("interaction01",  "param1-1", "value1-1");
dfInteracts.push(inter);
inter = new dfInteract("interaction02",  "param2-1", "value2-1",  "param2-2", "value2-2");
dfInteracts.push(inter);

// Handles the XML generated event.
function onXmlGenerated() {
	for (i=0; i<dfInteracts.length; i++) {
		addInteraction(dfInteracts[i]);
	}
}

/* Adds interaction code to the dom */
function addInteraction(dfit) {
	var rootEl = dom.getDocumentElement();
	var sXPath = "//interactions";
	var myNodes = Packages.org.apache.xpath.XPathAPI.selectNodeList(rootEl, sXPath);
	var interactionsEl = null;
	if (myNodes.getLength() > 0) {
		if (myNodes.item(0) != null) {
			interactionsEl = myNodes.item(0);
		}
		else {
			javelin.Trace("###Error during interactions init");
			return false;
		}
	}
	else {
		interactionsEl = context.addTextNodeUnderRoot("interactions", "");
	}

	var itemEl = context.addTextNode(interactionsEl, "interaction", "");
	var varEl;
	itemEl.setAttribute("dfevent", dfit.iname);
	for (j=0; j<dfit.getNumberOfParams(); j++) {
		sXPath = dfit.getParamValue(j);
		myNodes = Packages.org.apache.xpath.XPathAPI.selectNodeList(rootEl, sXPath);
		if (myNodes.getLength() > 0) {
			if (myNodes.item(0) != null) {
				varEl = context.addTextNode(itemEl, "variable", myNodes.item(0).getTextContent().replace(".", ""));
			}
		}
		else {
			varEl = context.addTextNode(itemEl, "variable", sXPath);
		}
		varEl.setAttribute("name", dfit.getParamName(j));
	}

	return true;
}

/* Mashup Composer interaction class */
/* Constructor params: s=interaction name, [param, value]n */
function dfInteract(s) {
	var nb_params = (arguments.length - 1)/2;
	this.iname = s;
	this.params = new Array();
	this.values = new Array();
	for (i=0; i<nb_params; i++) {
		this.params.push(arguments[2*i+1]);
		this.values.push(arguments[2*i+2]);
	}

	this.addParam = function(paramName, paramValue) {
						this.params.push(paramName);
						this.values.push(paramValue);
					}
	this.getNumberOfParams = function () {
								return this.params.length;
							}
	this.getParamName = function (nb) {
							return this.params[nb];
						}
	this.getParamValue = function (nb) {
							return this.values[nb];
						}
}
